window.bookSummaryJSON = "<p>Much like accountants, fey never forget a debt.</p> <p>Just as Fred is settling down in his new abode, he receives word that a favor is being called in, one he promised to a dangerously powerful member of otherworldly royalty. Bracing for danger, adventure, and unknown threats, Fred is instead asked to take on an entirely different role than anticipated.</p> <p>Acting as interim professor at one of the few universities for supernatural entities, Fred will have to navigate a strange environment, eccentric co-workers, and unenthusiastic students. Yet that alone wonâ€™t be enough, for this college has more history than the tales in its tomes.</p> <p>Remnants of the past that could put Fred, and his students, in mortal peril.</p> <p>Performed by Christopher Walker, Nora Achrati, Richard Rohan, Dawn Ursula, Carolyn Kashner, Chris Stinson, Amanda Forstrom, Eva Wilhelm, Alejandro Ruiz, Bradley Foster Smith, Cody Roberts, Colleen Delany, Danny Gavigan, Eric Messner, Henry W. Kramer, Holly Adams, James Konicek, Jessica Lauren Ball, Ken Jackson, Lydia Kraniotis, Michael John Casey, Nanette Savard, Ryan Haugen, Scott McCormick, Tia Shearer and Yasmin Tuazon.</p>"; 
